import React from "react";
import "./Footer.scss";

const Footer = () => {
  return (
    <div className="footercontainer my-20 ">
      <div className="mainfootercontainer">
        <div className="col"></div>
        <div className="col"></div>
        <div className="col"></div>
      </div>
    </div>
  );
};

export default Footer;
